    }
    if (is.null(rng)) 
        rng &lt;- range(x, na.rm = TRUE)
    rescaled &lt;- scales::rescale(x, from = rng)
    if (any(rescaled &lt; 0 | rescaled &gt; 1, na.rm = TRUE)) 
        warning("Some values were outside the color scale and will be treated as NA")
    if (reverse) {
        rescaled &lt;- 1 - rescaled
    }
    pf(rescaled)
}
