* Web APIs with curl
Under the hood, the httr (and thus curl) sends request somewhat like this
curl -X GET https://google.com -w "%{content_type}\n%{http_code}\n"
A get request (-X GET) to https://google.com, which also includes (-w) the following: content_type and http_code:
&lt;HTML&gt;&lt;HEAD&gt;&lt;meta http-equiv="content-type" content="text/html;charset=utf-8"&gt;
&lt;TITLE&gt;301 Moved&lt;/TITLE&gt;&lt;/HEAD&gt;&lt;BODY&gt;
&lt;H1&gt;301 Moved&lt;/H1&gt;
The document has moved
&lt;A HREF="https://www.google.com/"&gt;here&lt;/A&gt;.
&lt;/BODY&gt;&lt;/HTML&gt;
text/html; charset=UTF-8
301
We use the httr R package to make life easier.

Example: Square Roots
Let’s say we want to take the square roots of the numbers 1 to 10,000. We could achieve this in a number of different ways.
Here, we use a for loop:

forLoopRoots &lt;- function(n){
  roots &lt;- rep(NA, n)
  for(i in 1:n){
    roots[i] &lt;- sqrt(i)
  }
  return(roots)
}

head(forLoopRoots(10000))

[1] 1.000000 1.414214 1.732051 2.000000 2.236068 2.449490

Example: Square Roots (cont. 1)
Here, we’ll use sapply:

SapplyRoots &lt;- function(n){
  roots &lt;- sapply(1:n, sqrt)
  return(roots)
}

head(SapplyRoots(10000))

