Example: Repeated elements (cont. 1)
We can achieve this with two nested loops:

method1 &lt;- function(x){
  # first element cannot be a duplicate
  out &lt;- sapply(2:length(x), function(i){
    matches &lt;- sapply(1:(i-1), function(i2){
      x[i2] == x[i]
    })
    return(any(matches))
  })
  out &lt;- c(FALSE, out)
  return(out)
}

