Sentiment Analysis
We can now group and summarize this new dataset the same as any other. For example, let’s look at the sentiment by chapter. We’ll do this by counting the number of “positive” words and subtracting the number of “negative” words:

diff_by_chap &lt;- alice |&gt;
  unnest_tokens(word, text) |&gt;
  inner_join(get_sentiments("bing")) |&gt; 
  group_by(chapter) |&gt; 
  summarise(sentiment = sum(sentiment == "positive") - sum(sentiment == "negative"))

Sentiment Analysis
Alternatively, we could use the afinn lexicon and quantify the “sentiment” of each chapter by the average of all words with numeric associations:

avg_by_chap &lt;- alice |&gt;
  unnest_tokens(word, text) |&gt;
  inner_join(get_sentiments("afinn")) |&gt; 
  group_by(chapter) |&gt; 
  summarise(sentiment = mean(value))

Questions 1: How many ways can you write an XOR operator?
Write a function that takes two arguments (x,y) and applies the XOR operator element wise. Here you have a template:
myxor &lt;- function(x, y) {
  res &lt;- logical(length(x))
  for (i in 1:length(x)) {
    res[i] &lt;- # do something with x[i] and y[i]
  }
  return(res)
}
Or if vectorized (which would be better)
myxor &lt;- function(x, y) {
  # INSERT YOUR CODE HERE
}
Hint 1: Remember that negating (x & y) equals (!x | !y).
Hint 2: Logical operators are a distributive, meaning a * (b + c) = (a * b) + (a + c), where * and + are & or |.

* Or in python (bis)

def myxor(x,y):
    return np.logical_or(
        np.logical_and(x, np.logical_not(y)),
        np.logical_and(np.logical_not(x), y)
    )

ans['myxor'] = myxor(x,y)
pa.DataFrame(ans)

